In celebration of the 75th Anniversary of Gatlinburg's Charter in 1945, we are sharing stories of the people and places that have made Gatlinburg America's Mountain Home.

@olesmoky - The Moonshine Moonshot

Moonshining is part of our heritage here in the Smoky Mountains. We never have talked about it much, particularly once we took distilling underground to avoid extra taxes. It was just a way for us to provide a little extra cash for our families. “No one got rich off of it,” explains Gary Baker, who now mills about one million pounds of corn a year for Ole Smoky Moonshine. “It was about economics and feeding your family.” Gatlinburg.com/75th

