@gatlinburgskylift - A breathtaking look over the mountains and through the woods.

Hop on one of the iconic yellow chairs and you are transported up 500 feet to the top of Crockett Mountain and away from the bustle of the main strip. And when you reach the top, you absolutely must turn around for a view that will leave you breathless. Hopefully, Marcus Watson will be there to watch you do it. Gatlinburg.com/75th
